  return (
    <div>
        <Header />
        <div className="home-container">

            {/* Rest of your home page content goes here */}
            <div className="main-content">
                <h2>About Us Page</h2>
                <h3>Electrovolt Fueling Solutions is a division of EV Solutions Private Limited.</h3>
